column831:
14/Dec/23 2:55 PM;simon.auch@vodafone.com;Hi [~bharath.krishnamurthy@vodafone.com],

the relation is implicit, the posting rules select the OMNIUSTVCHANGEDMARKER once there is any change to the package. OSF needs to call the posting rules after any change to cable packages including bundle rules.

*OSF has to call the posting rules after any change to a cable package, otherwise inconsistencies regarding products/orders/etc are to be expected.* ;;;

